import PostsList from "./PostsList"
import {Link} from "react-router-dom"
import Button from '@mui/material/Button';

const Home = (user) => {
    

    return (
        <div>
            <h2>Welcome to CodeShare</h2>
            <Button component={Link} to="/newpost" color="inherit">Make a new post</Button>
            <h3>Posts</h3>
            <PostsList/>
        </div>
    )
}

export default Home;
